import React from 'react'

import Warning from "../assets/varning.png";

const WarningImage = () => {
  return (
    <div className="flex justify-center items-center w-[350px] h-[350px]">
      <img src={Warning} alt="warning-picture" className="w-full h-auto" />
    </div>
  )
}

export default WarningImage
